            return <div className='ui grid'>
                 <Book books={props.books} {...books} key={books.title} />
                 <div>
                 <div className='ui red button'>Delete</div>
                 </div>



            </div>



           })

           return (
        <div >
           <h1>BoekenLijst</h1>           
           <ul>{laadBoeken}</ul>                  
        </div>
    );

};

export default bookList;
